import React from 'react';
import './Partner.css';

const logos = [
  { id: 1, src: 'JSP1.svg', alt: 'Jindal Steel And Power' },
  { id: 2, src: 'Sail.png', alt: 'Sail' },
  { id: 3, src: 'asian tubes.png', alt: 'Asian Tubes & Pipes' },
  { id: 4, src: 'vibrant.png', alt: 'Vibrant TMT' },
  { id: 5, src: 'apollo.png', alt: 'Apollo Steel Pipes' },
  { id: 6, src: 'Surya.jpeg', alt: 'Surya Prakesh' },
  { id: 7, src: 'TATA.png', alt: 'TATA Steel' },
  { id: 8, src: 'ET.jpeg', alt: 'Electrotherm Steel(ET TMT)' },
  { id: 9, src: 'Vinayak.png', alt: 'Vinayak TMT Bars' },
  { id: 10, src: 'Steefo.svg', alt: 'Steefo TMT Bars' },
  { id: 11, src: 'Hitech.png', alt: 'Hi-Tech Pipes' },
  { id: 12, src: 'German.png', alt: 'German TMT' },
  
];

const Partner = () => {
  return (
    <div className="logo-gallery">
      {logos.map((logo) => (
        <div key={logo.id} className="logo-item">
          <img src={logo.src} alt={logo.alt} className="logo" />
        </div>
      ))}
    </div>
  );
};

export default Partner;
